import React from 'react';
import {H1} from '../components'
import styled from 'styled-components';

const Style = styled.div`
	display: flex;
	flex-direction: row;
	position: relative;

	&::after {
		background-color: red;
		content: '';
		position: absolute;
		top: calc(50%-2px);		
		height: 4px;
		width: 100%;
	}
`;

class TimelineItem extends React.Component {
	render() {
		return(
	    	<Style>

	    	</Style>		    
		)
	;}
}

export default TimelineItem;
